‚ú® GIVE/AWAY CLOSED ‚ú®

Last month officially marked 3 years since I started making dice! It's been a wild ride and I wanted to thank you all for your support on this journey, so I teamed up with a bunch of my friends to create something cool for you! I wanted this celebration to be special, so I asked my friends to tell me a story with their creations, so they each drew inspiration from their favorite stories, books, shows, characters, or campaigns, or made up their own! Check out their posts for their inspiration!

TO ENTER:

1. You MUST be following myself, and all other artists:
@arcanum.dice 
@peachpitdice 
@shipwreckdice 
@haileyjensenart 
@brokenbowdiceshop 
@fuzzyfinsdice 

2. Comment below, and tell me your favorite character's name, and tag two friends.

3. Read all give/away info! Add a ‚ú® to your first comment to show me you've read and understand it!

BONUS ENTRY:

For an additional entry, you can share this post to your story and tag me in it! When you're done, come back here and comment "Shared!"

RULES:

Give/away ends October 14th at 5pm ET. Must be 18 or older to enter. Winners may be responsible for shipping costs, at the discretion of each maker. Open internationally, except areas of active conflict or where USPS is restricted. Give/away is not affiliated with Instagram. 

‚ö†Ô∏è BEWARE OF SCAM ACCOUNTS ‚ö†Ô∏è

You will only be contacted by me, from this account, via story tag if you are selected. I will not reach out to anyone via DM. You will never be asked to follow external links, and I will not ask for personal information. Be CAREFUL!

