Richard Pallardy is a freelance writer based in Chicago. He has written for publications including National Geographic, Science Magazine, New Scientist, and Discover Magazine. He spent seven years as a research editor with Encyclopedia Britannica. His commentary has focused on the excesses of the progressive movement, which he believes to be in direct conflict with liberal values such as freedom of speech, freedom of expression, and freedom of inquiry. He strongly believes in the value of the individual, regardless of their background and immutable qualities.

